import React, { useState, useEffect, useRef } from "react";

function App() {

  const [numbersToSort, setNumbersToSort] = useState([])

  useEffect(() => {
    setNumbersToSort([1, 2, 3, 4, 5])
  }, [])

  const generateArray = (length) => {
    let tempArray = []
    for (let i = 0; i < length; i++) {
      var randomInteger = 20 + (Math.random() * (200 - 20));
      tempArray.push(randomInteger)
    }
    setNumbersToSort(tempArray)
  }

  return (
    <div className="App">
      <button onClick={() => { console.log(numbersToSort) }}>See Array</button>
    </div>
  );
}

export default App;
